package cn.com.phinfo.protocol;import java.util.List;import java.util.Stack;import com.alibaba.fastjson.annotation.JSONField;import com.heqifuhou.protocolbase.HttpResultBeanBase;import com.heqifuhou.protocolbase.QuickRunObjectBase;public class GroupRun extends QuickRunObjectBase {	public GroupRun(){		this("");	}	public GroupRun(final String search) {		super(LURLInterface.GET_URL_GROUP(search),null,GroupResultBean.class);	}	public static class GroupResultBean extends HttpResultBeanBase{		private List<GroupItem> listData = new Stack<GroupItem>();		public List<GroupItem> getListData() {			return listData;		}		public void setListData(List<GroupItem> listData) {			this.listData = listData;		}	}	public static class GroupItem{		@JSONField(serialize=false)		private boolean bSel;		public boolean isbSel() {			return bSel;		}		public void setbSel(boolean bSel) {			this.bSel = bSel;		}		private String groupId;		private String name;		public String getGroupId() {			return groupId;		}		public void setGroupId(String groupId) {			this.groupId = groupId;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}	}}